export const anotherName = () =>{
    return async (dispatch)=>{

        const res = await fetch("https://jsonplaceholder.typicode.com/posts?userId=1")
        const res2 = await res.json();
        dispatch({type: 'CHANGE_NAME',payLoad: res2[0].title})
    }
}
